  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Missisquoi NWR
  outlines Refuge accomplishments from May through August of 1945. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  and raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section of the report
  describes Refuge visitors and Refuge participation. N-R forms are attached.\",\n\t\"owner_org\":
